  "Initiated By" : "WASHINGTON",
  "Allegations" : "ON AUGUST 1, 2012, THE SECURITIES DIVISION ENTERED INTO A CONSENT ORDER WITH FINANCIAL SERVICES INTERNATIONAL CORP. (\"FSIC\") AND CANDACE JEAN LEE (\"LEE\").  THE SECURITIES DIVISION HAD PREVIOUSLY ISSUED A STATEMENT OF CHARGES, S-09-343-10-SC01, AGAINST FSIC AND LEE.   THE STATEMENT OF CHARGES ALLEGED THAT BY FAILING TO ENTER INTO WRITTEN ADVISORY AGREEMENTS, FAILING TO PROVIDE DISCLOSURE DOCUMENTS, AND FAILING TO PROVIDE A COMPLETE DESCRIPTION OF THE SHARE CLASS OPTION AND FEES OF MUTUAL FUNDS, FSIC AND LEE ENGAGED IN A PRACTICE WHICH WOULD OPERATE AS A DECEIT.  THE STATEMENT OF CHARGES FURTHER ALLEGED THAT FSIC AND LEE FAILED TO REASONABLY SUPERVISE FSIC REPRESENTATIVES IN THE OFFER AND SALE OF MUTUAL FUNDS.  WITHOUT ADMITTING OR DENYING THE SECURITIES DIVISION'S ALLEGATIONS, FSIC AND LEE AGREED TO CEASE AND DESIST FROM VIOLATING RCW 21.20.010 AND RCW 21.20.020.  LEE IS SUSPENDED FROM ACTING IN ANY PRINCIPAL OR SUPERVISORY CAPACITY WITH ANY FIRM FOR A PERIOD OF TWELVE MONTHS AND WILL HAVE TO RETAKE AND PASS THE EXAMINATION FOR REGISTRATION AS A GENERAL SECURITIES PRINCIPAL.  FSIC AND LEE WAIVED THEIR RIGHTS TO A HEARING AND JUDICIAL REVIEW OF THIS MATTER.",
