  "Broker Comment" : "THIS MATTER CONCERNING \"C\" SHARES OF MUTUAL FUNDS IN ACCOUNTS OF SOME CLIENTS SERVED BY MS. LEE AND TWO REPRESENTATIVES, AND HER SUPERVISION RELATED THERETO.  THERE WERE NO FINDINGS OF INTENTIONAL HARM OR ACTUAL INJURY TO CLIENTS.  MS. LEE AND FSIC HAS RECIEVED NO CLIENT COMPLAINTS.  MS. LEE CHOSE NOT TO CONTEST THIS MATTER TO AVOID THE EXPENSE AND DISTRACTION OF FURTHER ADMINISTRATIVE PROCEEDINGS.  MS. LEE COMMITS TO CONTINUE SERVING THE BEST INTERESTS OF CLIENTS IN FULL COMPLIANCE WITH ETHICAL STANDARDS AND REGULATIONS."
